INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1034501040, 0, "わあ……素敵なケーキね！\nえ？　キミが作ったの？\nすごいじゃない！", 11, 103411, 4, 1, "", 1, 0, 1034501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1034501041, "", "", 91, 0, "", "", "", "", "", 1034501);
