INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501043, 0, "え、このケーキ君の手作りなの？\nなによ至れり尽くせりじゃない。", 11, 105111, 4, 1, "", 1, 0, 1051501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501044, "", "", 91, 0, "", "", "", "", "", 1051501);
