INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501046, 0, "ここまでしてもらったら大人しく\n祝ってもらうしかないわね。\nいくら私でも時と場合は\nちゃんとわきまえるわよ。", 11, 105111, 6, 1, "", 1, 0, 1051501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501047, "", "", 91, 0, "", "", "", "", "", 1051501);
