INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501049, 0, "でも、もらってばかりなのは\n性に合わないから、今度お返しに\n体が丈夫になる薬でも\nプレゼントするわ。", 11, 105111, 6, 1, "", 1, 0, 1051501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1051501050, "", "", 91, 0, "", "", "", "", "", 1051501);
