INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1057501043, 0, "このケーキ、すごく美味しそうだね。\n有名なお店のケーキなのかな？\nえ？　あなたが自分で作ってくれたの？\nすごーい！", 11, 105711, 5, 1, "", 1, 0, 1057501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1057501044, "", "", 91, 0, "", "", "", "", "", 1057501);
