INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501046, 0, "ただ、そうですね……\n厚意に預かるばかり、\nというのも性に合いませんし。\n何かご褒美をあげましょう。", 11, 107011, 5, 1, "", 1, 0, 1070501);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501047, "", "", 91, 0, "", "", "", "", "", 1070501);
